import React, { useEffect, useState } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Container from "@material-ui/core/Container";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import Link from "next/link";

const useStyles = makeStyles((theme) => ({
  root: {
    background: "#56377E",
    marginTop: "3rem",
    overflow: "hidden",
  },

  fLogo: {
    transform: "scale(1.2)",
  },
  grid: { marginTop: "3rem" },
  botgrid: { marginTop: "3rem", marginBottom: "3rem" },
  gridnav: { marginTop: "3rem", color: "#D9F0FF" },
  smullgrid: { marginTop: "1rem" },
  fItemDescr: {
    color: "white",
    textAlign: "start",
    fontFamily:
      "Poppins, -apple-system, Helvetica Neue, BlinkMacSystemFont, Segoe UI, Roboto, Oxygen, sans-serif",
    fontWeight: 400,
  },
  line: {
    color: "white",
    marginTop: "5rem",
  },
  fNav: {
    color: "#D9F0FF",
  },
}));

function Header() {
  const classes = useStyles();
  useEffect(() => {
    setTouchDevice("ontouchstart" in document.documentElement);
  }, []);
  const [touchDevice, setTouchDevice] = useState(true);
  return (
    <>
      {(
        <>
          <div className={classes.root}>
            <Container>
              <Grid
                container
                direction="column"
                justify="space-between"
                spacing={10}
                alignItems="flex-start"
              >
                <Grid item xs={12}>
                    <div className={classes.header}>
						<a

						onClick={() => {
							window.location.href = '/';
						}}
					>
							<div className={classes.logo}>
								Old
								<br />
								Henry
							</div>
							<div className={classes.slogan}>{""}</div>
							</a>

							<img src="../messenger.png" className={classes.messenger2} ></img>
						</div>

                </Grid>

              </Grid>
            </Container>
          </div>
        </>
      )}
    </>
  );
}

export default Header;
